f alternative solutions/technologies&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Document application changes and development updates Guide and mentor team members&lt;/p&gt;\r\n', '&lt;p&gt;&lt;strong&gt;Tech Stack:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;JavaScript, Type Script, React.js, Redux, Jest, Git, JIRA, Confluence&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Must have Knowledge: -&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Nice to have:&lt;/strong&gt; -&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience working with Cloud Technologies (AWS, Azure, Docker, K8s, &amp;hellip;) - Experience in CI / C&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience in Test Driven Development (TDD)&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience with React.js&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience as Scrum Master&lt;/p&gt;\r\n', '1500000', '2000000', '', '', '', '', 'Permanent', 'Full Time', 'Day', 'Any', 'Industrial Automation', 'IT Software Development', 'India', '', '', '', 'hr@mancraftconsulting.com', 'B.Tech / MCA', '&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Strong proficiency of the JavaScript language including the ES6+ syntax, DOM manipulation, JavaScript object model and the Type Script superset&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Excellent understanding of React.js and its core principles&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; 5+ years of experience with React.js workflows such as Flux or Redux&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Minimum 6 years of experience in .NET development with C#&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Minimum 2 years of experience in development of API&amp;acute;s with .NET Core (3.1 and higher)&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Minimum 3 years of experience in developing unit and integration tests with N Unit or X Unit&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Minimum 3 years of experience in Entity Framework / Entity Framework Core&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience with relational databases such as MS SQL-Server or Postgre SQ&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Knowledge of modern authorization mechanisms and workflows&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience with common front end development tools like Babel, Web pack or NPM&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience with consuming API&amp;acute;s&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience in creating unit and integration tests with Mocha, Jest and/or React Testing Library&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Hands-On Mentality&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience in code versioning using Git&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Experience with client-side architecture and design patterns&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;middot;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Very good communication skills.&lt;/p&gt;\r\n', 1, '2022-11-11 08:33:18', '1', '2022-11-11 08:33:18', '1', 'NotDeleted'),
(13, 'Mancraft Consulting', 'Service Delivery Manager ', '', '', '&lt;p&gt;&lt;strong&gt;ROLE AND RESPONSIBILITIES&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Strong Experience in managing support projects.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Should have a service-oriented attitude and a keen focus on enhancing customer experience.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Excellent situational awareness in handling customer expectations&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Drive stakeholder engagement and maintain CSAT&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Should have strong convincing skills and the ability to handle tough situations&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Provide guidance, mentoring, training, and delegate responsibilities to leads&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Should have strong escalation management experience with multiple stakeholders including customers&lt;/p&gt;\r\n\r\n&lt;p&gt;and product teams&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Ability to develop and deliver creative business solutions for complex problems&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Ability to work on compelling timelines and handle delivery pressures.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Should be able to handle multiple customers and large team structure&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Develop and Maintain Support Procedures&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Ensure SLA&amp;#39;s are met as per the customer guidelines&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Deliver regular reporting on the business performance and SLA&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Provide value adds to Customers&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;bull; Should have clear understanding of ITIL Process&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n', '&lt;p&gt;Project Management, JIRA, DevOps, C# .Net, ITIL&amp;nbsp;&lt;/p&gt;\r\n', '1200000', '1500000', '', '', '', '', 'Permanent', 'Full Time', 'Day', 'Boys', 'Industrial Automation', 'Project Management', 