(14, 'Mancraft Consulting', 'Travel Consultant/Sr. Travel Consultant', '', '', '&lt;p&gt;&lt;strong&gt;JOB PURPOSE &lt;/strong&gt;The role is responsible for providing unparalleled customer service and assistance with all (domestic &amp;amp; international) aspects of business travel requirements to our Corporate Travel Customers. Travel Consultants are expected to utilize their industry, product and destination knowledge to effectively and efficiently provide quotes and booking services.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Key Responsibilities&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Provide unparalleled consultative customer service and professionalism to the client customer experience by arranging and assisting with travel reservations.&lt;/li&gt;\r\n	&lt;li&gt;Ensure client is appropriately informed of and represented in all terms and conditions during the travel booking process including their security processes and handle pre-ticketing procedures.&lt;/li&gt;\r\n	&lt;li&gt;Meet and exceed client service level agreements in regard to pre-booking, booking finalization, and follow-up on outstanding bookings.&lt;/li&gt;\r\n	&lt;li&gt;Proactively escalate potential client, supplier, or program issues to the manager for timely resolution.&lt;strong&gt;&amp;nbsp;&amp;nbsp;&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;Follow SLA assigned&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Monitor and sort the Global Distribution System (GDS) to maintain quality&lt;/li&gt;\r\n	&lt;li&gt;Maintain productivity in line with KPIs, ensuring high-quality error-free transactions,&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Assist interoffice departments to fulfill client requirements (MIS)&lt;/li&gt;\r\n	&lt;li&gt;Assist Finance in recovering debts from the client.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Support the Products team through brainstorming opportunities and running programs related to different products viz, air, hotels etc. for clients, e.g. as an initiative to gain momentum and increase business.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;SKILLS AND COMPETENCIES:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Excellent verbal and written communication skills&lt;/li&gt;\r\n	&lt;li&gt;Excellent Customer service skills in a travel environment&lt;/li&gt;\r\n	&lt;li&gt;Strong time management and organizational skills including multi-tasking and prioritizing of workload&lt;/li&gt;\r\n	&lt;li&gt;Extremely organized and can work well under stressful circumstances.&lt;/li&gt;\r\n	&lt;li&gt;Strong attention to detail&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Maintaining up-to-date knowledge of international travel notifications and guidelines as per government/ client rulings&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;Good Hold on CRS (Amadeus)&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;VISA, Insurance &amp;amp; Ticketing knowledge.&lt;/li&gt;\r\n	&lt;li&gt;Knowledge of products including car hire, hotels and rail&lt;/li&gt;\r\n	&lt;li&gt;Domestic &amp;amp; International destination/geographical knowledge&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '400000', '600000', '', '', '', '', 'Permanent', 'Full Time', 'Day', 'Any', 'Travel &amp; Tourism', 'Travel Consultant', 'Bangalore/Mumbai/Ahmedabad/Noida/Gurgaon', '', '', '', 'mancraft@mancraftconsulting.com', 'Any Graduate', '&lt;p&gt;&lt;strong&gt;RELEVANT EXPERIENCE&lt;/strong&gt; &amp;ndash;Must have 3-6 yrs. of Experience in both International &amp;amp; Domestic Travel/Ticketing&lt;/p&gt;\r\n', 1, '2022-12-03 08:25:31', '1', '2022-12-03 08:25:31', '1', 'NotDeleted'),
(15, 'Mancraft Consulting', 'RightAngle Application Developer (ETRM/CTRM)', '', '', '&lt;p&gt;&lt;strong&gt;Job role for Right Angle Developer&amp;nbsp;(ETRM/CTRM)&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Design and develop custom extensions to Right Angle&amp;nbsp;system implementations to the unique needs of the client&lt;/li&gt;\r\n	&lt;li&gt;Develops integration interfaces and data conversion processes&lt;/li&gt;\r\n	&lt;li&gt;Designs and develops customized reports&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;Good Experience in Right Angle is Must&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;Experience with: C#, .NET, SQL Server&lt;/li&gt;\r\n	&lt;li&gt;Good skills on SQL and .Net/ Class events.&lt;/li&gt;\r\n	&lt;li&gt;Have worked on or previously supported the integration of Right Angle&lt;/li&gt;\r\n	&lt;li&gt;Worked on Agile methodologies&lt;/li&gt;\r\n	&lt;li&gt;Familiar with deployment and enhancements and customizations.&lt;/li&gt;\r\n	&lt;li&gt;Ability to communicate problems and solutions effectively with business and technical stakeholders&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '&lt;p&gt;C#, .NET, SQL Server,&amp;nbsp; SQL, and .Net/ Class events&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n', '30,00,000', '36,00,000', '', '', '', '', 'Permanent', 'Full Time', 'Day', 'Any', 'ITES/IT Software Services', 'Application Development', 'India/UK', '', '', '', 'mancraft@mancraftconsulting.com', 'Graduate', '&lt;p&gt;&lt;strong&gt;Experience &lt;/strong&gt;- 5 to 10 years,&amp;nbsp;Relevant at least 3 Years in RightAngle application.&lt;/p&gt;\r\n', 1, '2022-12-03 09:29:24', '1', '2022-12-03 09:29:24', '1', 'NotDeleted'),
(16, 'Mancraft Consulting', 'Right Angle Functional Consultant (ETRM/CTRM)', '', '', '&lt;ul&gt;\r\n	&lt;li&gt;Provide industry and functional advice and troubleshooting in the discovery workshop, design, implementation, testing, and production support of the Product solution for the client&amp;rsquo;s business needs.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Present the Product solution to client users.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Support the deliverables of the technical consultants by providing business and functional guidance, review, testing, and validation of scripted solutions (reports, plugins, and interfaces).&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Consult with client users to determine business requirements and work processes to be addressed by one or more areas of the Product solution.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Demonstrate deep knowledge in one or more areas of Product configuration and in one or more energy commodities.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Provide guidance to Business Consultants in one or more functional areas of the Product solution.&lt;/li&gt;\r\n	&lt;li&gt;Assist with professional services best practices as directed by line manager.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Assume hands-on project implementation duties in all phases of the Product implementation, reporting to the Project Manager.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Gather and document business requirements, configuration designs, test plans/results, and any other deliverables required by the project as determined by the Project Manager and Lead Business Consultant.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Adhere to implementation best practices in one or more functional areas of the solution in all functional design, specifications, custom coding, and unit testing deliverables.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Follow documentation standards and resolution process flow for all deliverables.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Maintain full chargeability on client account(s) as assigned&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '&lt;p&gt;RightAngle, CTRM, ETRM, Functional Consultant, Application review, testing, and validation of scripted solutions (reports, plugins, and interfaces), Agile Certified.&lt;/p&gt;\r\n', '30,00,000', '36,00,000', '', '', '', '', 'Permanent', 'Full Time', 'Day', 'Boys', 'ITES/IT software services', 'Tech Functional Consultatnt', 'India/UK', '', '', '', 'mancraft@mancraftconsulting.com', 'Graduate+ MBA', '&lt;p&gt;Education: B.Tech + MBA&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Experience &lt;/strong&gt;- 5 to 10 years,&amp;nbsp;Relevant at least 3 Years in RightAngle application.&lt;/p&gt;\r\n', 1, '2022-12-03 09:46:14', '1', '2022-12-03 09:46:14', '1', 'NotDeleted'),
(17, 'Mancraft Consulting', 'Production Manager (Garment Export)', '', '', '&lt;ul&gt;\r\n	&lt;li&gt;Review Capacity booking plan to ensure optimum production capacity utilization from cut to pack and coordinate with relevant departments to fulfill any open capacity&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Review weekly Line plan and corresponding cutting and finishing production and manpower plans of all the MF in detail&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Make a plan for all out-house job works and communicate it to the Out-sourcing Officer&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Review daily production analysis reports like Efficiency, cost, plan v/s actual etc. &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Conduct daily review meetings with Planning, IE and production manager for the productivity and efficiency achieved&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Gap analysis of the targets not achieved, work out solutions for the same and make sure it is implemented&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Make sure corrective action is taken for deviations from planning if any and ensure 100% on-time deliveries&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Drive continuous improvements and improve on efficiency levels with I.E. team&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Work on cost controlling measures in the production processes and improve company benchmarks&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Monitor plan v/s actual performance of all the production processes&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Make sure required manpower is fulfilled and utilized to optimum in coordination with HR dept.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Attend process meeting and PPM for every style&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Review budgeted manpower to actual of all production department and rationalize any over-budget performance to Senior VP/Unit head.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Review OCR report verified by the related PM for every style&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Coordinate with quality head / QAM for resolution of any quality-related issues&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Approve piece rates for sewing and outhouse job work &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Recommend appraisals for the production team to VP with their KPI review&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '&lt;p&gt;&lt;strong&gt;Knowledge &amp;amp; Skills&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Technical garment construction knowledge&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;General quality parameters in cutting, sewing and finishing&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Good Coordination and communication skills&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '10,00,000', '15,00,000', '', '', '', '', 'Permanent', 'Full Time', 'Day', 'Boys', 'Garment Export/Textile', 'Garment Manufacturing', 'Noida -India', '', '', '', 'mancraft@mancraftconsulting.com', 'Any Graduate', '&lt;p&gt;&lt;strong&gt;Qualification &amp;amp; Experience&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;B.tech/Graduate from a reputed institute with 10+ years of experience. &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', 1, '2022-12-03 10:14:07', '1', '2022-12-03 10:14:07', '1', 'NotDeleted'),
(18, 'Mancraft Consulting', 'Full Stack Developer', '', '', '&lt;p&gt;&lt;strong&gt;RESPONSIBILITIES:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Contribute to Avery Dennison&amp;#39;s digital transformation journey using modern technologies (Cloud, IoT, Big Data and Web3.0)&lt;/li&gt;\r\n	&lt;li&gt;Design and Develop quality software application modules using Java/Node JS and React JS&lt;/li&gt;\r\n	&lt;li&gt;Practice and guide to build high-quality software using automated test cases (unit and integration)&lt;/li&gt;\r\n	&lt;li&gt;Works closely with PO, Scrum Master and Technical lead team to identify product requirements and translate them into component design and code&lt;/li&gt;\r\n	&lt;li&gt;Participate in code reviews and design reviews&lt;/li&gt;\r\n	&lt;li&gt;Help team to breakdown user stories, solve technical/design issues and identify tools, process for improving team communication and collaboration&lt;/li&gt;\r\n	&lt;li&gt;Keeping up-to-date with industry trends and developments&lt;/li&gt;\r\n	&lt;li&gt;Confident in using Azure Cloud PaaS and SaaS services to solve business problems&lt;/li&gt;\r\n	&lt;li&gt;Troubleshoot application issues using developer tools&lt;/li&gt;\r\n	&lt;li&gt;Capable of taking well-defined sub-tasks and completing these tasks&lt;/li&gt;\r\n	&lt;li&gt;Work in a Scrum Agile team&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;WHAT WE WILL BE LOOKING FOR IN YOU:-&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Bachelor&amp;rsquo;s degree in computer science, engineering, and a related field experience(6-9Yrs)&lt;/li&gt;\r\n	&lt;li&gt;Master in productivity tools like source control (Git), editors(VS Code/IntelliJ), the build system (Git hub action), and other tools as well as testing best practices&lt;/li&gt;\r\n	&lt;li&gt;He/she has very good understanding of Web and Cloud application development using JAVA/Node JS and React JS&lt;/li&gt;\r\n	&lt;li&gt;Proven track record of delivering IoT system on Azure cloud using Micro services/Server less and IoT architecture&lt;/li&gt;\r\n	&lt;li&gt;Deep&amp;nbsp; understanding of IoT Product life cycle, Security, Logging and Monitoring framework and tools&lt;/li&gt;\r\n	&lt;li&gt;Able to apply Cloud Architectural &amp;amp; Design Patterns and produce sub system design&lt;/li&gt;\r\n	&lt;li&gt;Experienced in No SQL or SQL database design, development and deployment using CICD&lt;/li&gt;\r\n	&lt;li&gt;Excellent technical, diagnostic, and troubleshooting skills&lt;/li&gt;\r\n	&lt;li&gt;Excellent communication, motivational, and interpersonal skills&lt;/li&gt;\r\n	&lt;li&gt;Able to create good relationships with team members and motivate them&lt;/li&gt;\r\n	&lt;li&gt;Very good understanding of Azure IoT Hub, IoT Central(Optional), Event hub, Service Bus, MQTT, Web Sockets, Docker, Kubernetes and API Gateway&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '&lt;p&gt;&lt;strong&gt;Key Skills: Azure, AKS; Kubernetes, Azure IoT, Azure IoT hub, Azure IoT Central, Nodejs, React JS, Experience in IoT/IIOT&lt;/strong&gt;&lt;/p&gt;\r\n', '24,00,000', '27,00,000', '', '', '', '', 'Permanent', 'Full Time', 'Night', 'Any', 'IT Software Services', 'Software Development', 'Noida/Bangalore', '', '', '', 'mancraft@mancraftconsulting.com', 'B.Tech/ BCA/MCA', '&lt;p&gt;Bachelor&amp;rsquo;s degree in computer science, engineering, and a related field experience(6-9Yrs)&lt;/p&gt;\r\n', 1, '2022-12-03 11:17:38', '1', '2022-12-03 11:17:38', '1', 'NotDeleted'),
(19, 'Mancraft Consulting', 'Java Lead System Analyst', '', '', '&lt;p&gt;&lt;strong&gt;RESPONSIBILITIES:-&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Hands-on experience in analysis, design, coding, and implementation of complex, custom-built applications.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Strong Java Backend Coding required&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Strong OO skills, including strong design patterns knowledge&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Strong understanding with few databases, like MySQL, PostgreSQL, NoSQL etc.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Knowledge of software best coding standard &amp;amp; practices&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Knowledge or REST &amp;amp; SOAP Web Services&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;System Analysts role is to plan, design, develop.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Should have an ability to design J2EE technical solutions&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Ensure the quality of architecture and design of systems.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;2-3 years of experience in software design, modelling and documentation to meet customer needs within project timeline constraints.&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Good to have:&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Python experience or understanding good to have.&amp;nbsp;&lt;/li&gt;\r\n	&lt;li&gt;Ready to learn and work on Python if needed.&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '&lt;p&gt;Strong Java Backend Coding,&amp;nbsp;MySQL, PostgreSQL, NoSQL, Strong OO skills, Python&lt;/p&gt;\r\n', '25,00,000', '27,00,000', '', '', '', '', 'Permanent', 'Full Time', 'Night', 'Any', 'IT Software Services', 'Software Development', 'Noida/Bangalore', '', '', '', 'mancraft@mancraftconsulting.com', 'B.Tech / BCA/ MCA', '&lt;p&gt;&lt;strong&gt;Experience: &lt;/strong&gt;7 to 15 years of Hands-on development experience using any of technology java and python.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;2-3 years of experience in software design, modelling and documentation to meet customer needs within project timeline constraints.&amp;nbsp;&lt;/p&gt;\r\n', 1, '2022-12-03 11:28:13', '1', '2022-12-03 11:28:13', '1', 'NotDeleted'),
